import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();
  return (
    <div className="section">
      <h1>Dashboard</h1>
      <button onClick={() => navigate("/")}>Go to Home</button>
    </div>
  );
};

export default Dashboard;
